import React from 'react'
import { Link } from 'react-router-dom'

const NoteItem = ({ note }) => {
  return (
    <Link to={`/note/${note.id}`}>
      <h3 className='notes' >{note.body}</h3>
    </Link>
  )
}

export default NoteItem
